import React from 'react';
import styles from './Login.module.css';

function Login() {
  return (
    <div className={styles.loginContainer}>
      <div className={styles.loginBox}>
        <img src="/fsph_logo.png" alt="FSPH Logo" className={styles.logo} />
        <h2>Login</h2>
        <p>Digite seus dados de acesso nos campos abaixo:</p>
        <form action="#" method="post">
          <div className={styles.inputGroup}>
            <label htmlFor="identificacao">Identificação</label>
            <input type="text" id="identificacao" name="identificacao" placeholder="Digite seu ID institucional" required />
          </div>
          <div className={styles.inputGroup}>
            <label htmlFor="senha">Senha</label>
            <input type="password" id="senha" name="senha" placeholder="Digite sua senha de acesso" required />
          </div>
          <a href="#" className={styles.forgotPassword}>Esqueci minha senha</a>
          <button type="submit" className={styles.loginButton}>Acessar</button>
        </form>
      </div>
    </div>
  );
}

export default Login;
